import "./home.css";

const HomePage = () => {
  return (
    <main className="home-container">
      <div className="home-header">User List</div>
      <div className="context-box">
        <h1>Sảnh sự kiện</h1>
      </div>
    </main>
  );
};

export default HomePage;
